import React from 'react';
import Iridescence from '../components/Iridescence';
import './LoginPage.css';

export default function LoginPage() {
  return (
    <div className="login-page">
      {/* Iridescence фон */}
      <div className="login-background">
        <Iridescence
          color={[0.8, 0.3, 0.3]}
          mouseReact={false}
          amplitude={0.1}
          speed={1.0}
        />
      </div>
    </div>
  );
}
